(1, 1, '2018-04-05 09:11:12', '2018-04-05 09:11:12', 'Welcome to WordPress. This is your first post. Edit or delete it, then start writing!', 'Hello world!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2018-04-05 09:11:12', '2018-04-05 09:11:12', '', 0, 'http://localhost:8080/me/?p=1', 0, 'post', '', 1),
(2, 1, '2018-04-05 09:11:12', '2018-04-05 09:11:12', 'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost:8080/me/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2018-04-05 09:11:12', '2018-04-05 09:11:12', '', 0, 'http://localhost:8080/me/?page_id=2', 0, 'page', '', 0),
(4, 1, '2018-04-05 09:52:34', '2018-04-05 09:52:34', '<section class=\"fw-main-row \">\n	<div class=\"fw-container\">\n		<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-12 \">\r\n    <div id=\"col_inner_id-5e4f34906618c\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n<div class=\"block-title\">\n    <h3>What I Do<span></span></h3>\n</div>\n	</div>\r\n</div>\r\n</div>\n\n<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-6 \">\r\n    <div id=\"col_inner_id-5e4f349066eaf\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n<div id=\"info-list-5e4f3490677fc\" class=\"info-list-w-icon\">\n	\n					<div id=\"info_block_with_icon_806ca939f7422ebf5c337528336de68d\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"lnr lnr-laptop-phone\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>Software development</h4>\n		        <p>I am a systems engineer who likes to write clean code, worrying about good practices. I write code for backend using technologies such as the .Net stack and NodeJs. On the other hand I use ReactJs to write code on the FrontEnd side</p>\n		    </div>\n		</div>\n					<div id=\"info_block_with_icon_51edc3b98a88fe10486a1f182b49463a\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"lnr lnr-screen\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>Web Design</h4>\n		        <p>I use the Wordpress framework to carry out work related to web design, implement themes, plugins and even the Wordpress Rest API if necessary.</p>\n		    </div>\n		</div>\n	</div>\n	</div>\r\n</div>\r\n\r\n\r\n<div class=\" col-xs-12 col-sm-6 \">\r\n    <div id=\"col_inner_id-5e4f349067d44\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n<div id=\"info-list-5e4f3490681ec\" class=\"info-list-w-icon\">\n	\n					<div id=\"info_block_with_icon_8363fa56033de68e4f1d1b2758b96651\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"lnr lnr-pencil\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>Advice and support</h4>\n		        <p>I help you understand your need and find the best solution, as well as the best tools to carry out the solution.</p>\n		    </div>\n		</div>\n					<div id=\"info_block_with_icon_3b86d178eb46112cf695b1ea2945aced\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"lnr lnr-flag\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>Requirements Engineer</h4>\n		        <p>I help to understand the exact needs to carry out these functions and actions to carry out the development of the system.</p>\n		    </div>\n		</div>\n	</div>\n	</div>\r\n</div>\r\n</div>\n\n<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-12 \">\r\n    <div id=\"col_inner_id-5e4f349068b00\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n<div class=\"block-title\">\n    <h3>Work Experience<span></span></h3>\n</div>\n\n<div id=\"clients_42a44ca3c37ab56be197fbde52270f20\" class=\"clients owl-carousel\" data-mobile-items=\"2\" data-tablet-items=\"6\" data-items=\"6\">\n\n			<div class=\"client-block\">\n						<a href=\"https://www.redsis.com/\" target=\"_blank\" title=\"Redes y Sistemas Integrados S.A.S.\" rel=\"noopener noreferrer\">\n			\n								<img src=\"8080/me/wp-content/uploads/2020/02/logo-redsis.png\" alt=\"Redes y Sistemas Integrados S.A.S.\">\n\n						</a>\n					</div>\n			<div class=\"client-block\">\n						<a href=\"https://maestrik.com/\" target=\"_blank\" title=\"Maestrik S.A.S.\" rel=\"noopener noreferrer\">\n			\n								<img src=\"8080/me/wp-content/uploads/2020/02